import React, { Component } from "react";
import StarmapResult from "./starmapResult";

import Failure from "../components/failure";
import { connect } from "react-redux";

export class NeowsStatus extends Component {
  render() {
    let renderedStarmap;

    if (!this.props.default) {
      renderedStarmap = <StarmapResult />;
    }

    if (this.props.showResult) {
      renderedStarmap = <StarmapResult finalQuery={this.props.finalQuery} />;
    }

    if (this.props.failure) {
      renderedStarmap = <Failure />;
    }

    return <div>{renderedStarmap}</div>;
  }
}

const mapStateToProps = state => {
  state = state.FormReducer;
  return {
    default: state.default,
    showResult: state.showResult,
    failure: state.isFailure
  };
};

const starmapStatusConnected = connect(mapStateToProps)(NeowsStatus);
export default starmapStatusConnected;
